func testVaultToManyAddOpSigningRequests(t *testing.T) {
	var err error

	ctx := context.Background()
	tx := MustTx(boil.BeginTx(ctx, nil))
	defer func() { _ = tx.Rollback() }()

	var a Vault
	var b, c, d, e SigningRequest

	seed := randomize.NewSeed()
	if err = randomize.Struct(seed, &a, vaultDBTypes, false, strmangle.SetComplement(vaultPrimaryKeyColumns, vaultColumnsWithoutDefault)...); err != nil {
		t.Fatal(err)
	}
	foreigners := []*SigningRequest{&b, &c, &d, &e}
	for _, x := range foreigners {
		if err = randomize.Struct(seed, x, signingRequestDBTypes, false, strmangle.SetComplement(signingRequestPrimaryKeyColumns, signingRequestColumnsWithoutDefault)...); err != nil {
			t.Fatal(err)
		}
	}

	if err := a.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = b.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}
	if err = c.Insert(ctx, tx, boil.Infer()); err != nil {
		t.Fatal(err)
	}

	foreignersSplitByInsertion := [][]*SigningRequest{
		{&b, &c},
		{&d, &e},
	}

	for i, x := range foreignersSplitByInsertion {
		err = a.AddSigningRequests(ctx, tx, i != 0, x...)
		if err != nil {
			t.Fatal(err)
		}

		first := x[0]
		second := x[1]

		if !queries.Equal(a.ID, first.VaultID) {
			t.Error("foreign key was wrong value", a.ID, first.VaultID)
		}
		if !queries.Equal(a.ID, second.VaultID) {
			t.Error("foreign key was wrong value", a.ID, second.VaultID)
		}

		if first.R.Vault != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}
		if second.R.Vault != &a {
			t.Error("relationship was not added properly to the foreign slice")
		}

		if a.R.SigningRequests[i*2] != first {
			t.Error("relationship struct slice not set to correct value")
		}
		if a.R.SigningRequests[i*2+1] != second {
			t.Error("relationship struct slice not set to correct value")
		}

		count, err := a.SigningRequests().Count(ctx, tx)
		if err != nil {
			t.Fatal(err)
		}
		if want := int64((i + 1) * 2); count != want {
			t.Error("want", want, "got", count)
		}
	}
}

